// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./Ownable.sol";

interface ERC20Interface {
  function transferFrom(address from, address to, uint tokens) external returns (bool success);
}


contract StorageManagementV1 is Ownable{
  constructor(uint256 _baseFee){
    baseCurrencyPerDiam = _baseFee;
  }

  ERC20Interface public payingToken;

  mapping(address => bool) private admins;

  modifier onlyAdmins{  
    require(admins[_msgSender()]==true,"not admin");
    _;
  }

  event BaseCurrencyRateAdjusted(uint256 indexed newAmount);
  event AlternateCurrencyRateAdjusted(uint256 indexed newAmount);
  event TimeAdded(bytes32 fileHash, uint256 addedTime);
  event AdminAdded(address indexed newAdmin);
  event AdminRemoved(address indexed oldAdmin);

  struct FileStorageContract{
    bytes32 fileHash;
    uint256 expireTime;  
  }
  //deal with the admin part
  mapping (bytes32 => FileStorageContract) private activeContracts;
  mapping (address => uint256) private alternateCurrencyPerDiam;
  address[] acceptedTokens;
  uint256 private baseCurrencyPerDiam;


  function addTime(bytes32 fileHash) 
  public payable returns(uint256){
    require(msg.value >= baseCurrencyPerDiam,"1 day minimum");
    uint256 durationInDays = (msg.value/baseCurrencyPerDiam);
    return _addTime(fileHash, durationInDays);
  }


  function addTime (bytes32 fileHash,  address currency , uint256 amount) 
  public returns(uint256) {
    require(alternateCurrencyPerDiam[currency]>0,"unsupported currency");
    require(amount > alternateCurrencyPerDiam[currency],"must buy at least 1 day");
    payingToken.transferFrom(msg.sender, owner(), amount);
    uint256 durationInDays = (amount / alternateCurrencyPerDiam[currency]);
    return _addTime(fileHash, durationInDays);
  } 


  function _addTime(bytes32 fileHash, uint256 timeInDays) private returns(uint256){
    uint256 time = timeInDays * 1 days;
    if(activeContracts[fileHash].expireTime > block.timestamp){
      emit TimeAdded(fileHash, timeInDays);
      return activeContracts[fileHash].expireTime + time;
    }
    else{
      activeContracts[fileHash].expireTime = block.timestamp + time;
      emit TimeAdded(fileHash, timeInDays);
      return activeContracts[fileHash].expireTime * 1 days;
    } 
  }


  function timeLeft(bytes32 fileHash) public view returns (uint256){
    require(activeContracts[fileHash].expireTime != 0,"contract not found");
    if(activeContracts[fileHash].expireTime > block.timestamp){
      return (activeContracts[fileHash].expireTime - block.timestamp) / 1 days;
    }
    else{
      return 0;
    }
  }


  function getRate() public view returns (uint256){
    return baseCurrencyPerDiam;
  }


  function getRate(address currency) public view returns(uint256){
    return alternateCurrencyPerDiam[currency];
  }


  function adminAddTime(bytes32 fileHash,uint256 durationInDays) 
  public onlyAdmins returns(uint256) {
      return _addTime(fileHash, durationInDays);
  }


  function adjustRate(uint256 amount) public onlyAdmins{
    baseCurrencyPerDiam = amount;
    emit BaseCurrencyRateAdjusted(baseCurrencyPerDiam);
  }


  function adjustRate(address currency, uint256 amount) public onlyAdmins{
    alternateCurrencyPerDiam[currency] = amount;
    emit AlternateCurrencyRateAdjusted(amount);
  }


  function addAdmin(address newAdmin) public onlyOwner{
    require(newAdmin!=address(0),"address(0) no");
    admins[newAdmin] = true;
    emit AdminAdded(newAdmin);
  }


  function removeAdmin(address oldAdmin) public onlyOwner{
    require(oldAdmin!=owner(),"owner stays");
    admins[oldAdmin] = false;
    emit AdminRemoved(oldAdmin);
  }


  function addAcceptedToken(address tokenContract, uint256 perDiam) public onlyAdmins{
    require(isContract(tokenContract), "not valid");
    alternateCurrencyPerDiam[tokenContract] = perDiam;
    acceptedTokens.push(tokenContract);
  }


  function removeAcceptedToken(address tokenContract) public onlyAdmins{
    alternateCurrencyPerDiam[tokenContract] = 0;
    _removeToken(tokenContract);
  }


  function _removeToken(address token) private {
    for(uint i=0; i < acceptedTokens.length;i++){
      if(acceptedTokens[i]==token){
        acceptedTokens[i] = acceptedTokens[acceptedTokens.length - 1];
        delete acceptedTokens[acceptedTokens.length - 1];
      }
    }
  }


  function isContract(address account) internal view returns (bool) {
        // This method relies on extcodesize, which returns 0 for contracts in
        // construction, since the code is only stored at the end of the
        // constructor execution.

        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }
}
